DROP SCHEMA IF EXISTS hc CASCADE;

CREATE SCHEMA IF NOT EXISTS hc AUTHORIZATION postgres;

DROP SCHEMA IF EXISTS po CASCADE;

CREATE SCHEMA IF NOT EXISTS po AUTHORIZATION postgres;

create table hc.hc_addresses (
	address_id INT PRIMARY KEY,
	person_id VARCHAR(1),
	date_from DATE,
	date_to DATE,
	address_type VARCHAR(6),
	address_line_1 VARCHAR(50),
	address_line_2 VARCHAR(50),
	address_line_3 VARCHAR(50),
	city VARCHAR(50),
	region VARCHAR(50),
	postal_code VARCHAR(50),
	country VARCHAR(50),
	created_by INT,
	created_date DATE,
	last_updated_date DATE,
	last_updated_by INT
);

COMMENT ON TABLE hc.hc_addresses IS 'Person address';

COMMENT ON COLUMN hc.hc_addresses.address_type IS 'Office or residence';


create table hc.hc_email_addresses (
	email_id INT PRIMARY KEY,
	person_id VARCHAR(1),
	date_from DATE,
	date_to DATE,
	email_type VARCHAR(8),
	email_address VARCHAR(50),
	created_by INT,
	created_date DATE,
	last_updated_by INT,
	last_updated_date DATE
);

COMMENT ON COLUMN hc.hc_email_addresses.email_type IS 'Office or residence';


create table hc.hc_personal_identities (
	personal_identity_id INT PRIMARY KEY,
	person_id VARCHAR(1),
	issued_date DATE,
	expiry_date DATE,
	personal_identity_type VARCHAR(22),
	personal_identity_number VARCHAR(50),
	created_by INT,
	created_date DATE,
	last_updated_by INT,
	last_updated_date DATE
);

create table hc.hc_phones (
	phone_id INT PRIMARY KEY,
	person_id VARCHAR(1),
	date_from DATE,
	date_to DATE,
	phone_type VARCHAR(6),
	phone_number VARCHAR(50),
	country_code VARCHAR(50),
	extension VARCHAR(50),
	area_code VARCHAR(50),
	created_by INT,
	created_date DATE,
	last_updated_by INT,
	last_updated_date DATE
);

create table hc.hc_all_people (
	person_id INT,
	effective_start_date DATE,
	effective_end_date DATE,
	primary_email_id INT,
	primary_phone_id INT,
	mailing_address_id INT,
	residence_address_id INT,
	correspondence_language VARCHAR(50),
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	middle_name VARCHAR(50),
	blood_type VARCHAR(3),
	date_of_birth DATE,
	country_of_birth VARCHAR(50),
	city_of_birth VARCHAR(50),
	date_of_death DATE,
	country_of_death VARCHAR(50),
	city_of_death VARCHAR(50),
	marital_status VARCHAR(8),
	gender VARCHAR(50),
	employee_number VARCHAR(50),
	created_by INT,
	created_date DATE,
	last_updated_by INT,
	last_updated_date DATE
);

create table hc.hc_contact_relationships (
	contact_relationship_id INT,
	contact_person_id INT,
	person_id VARCHAR(1),
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	beneficiary_flag VARCHAR(50),
	contact_type VARCHAR(13),
	dependent_flag VARCHAR(50),
	primary_contact_flag VARCHAR(50),
	effective_start_date DATE,
	effective_end_date DATE,
	emergency_contact_flag DATE,
	created_by INT,
	created_date DATE,
	last_updated_by INT,
	last_updated_date DATE
);






CREATE TABLE IF NOT EXISTS po.po_agents (
	po_agent_id serial PRIMARY KEY,
	first_name VARCHAR NOT NULL ,
	last_name VARCHAR,
	authorization_limit INT,
	start_date_active DATE NOT NULL,
	end_date_active date NOT NULL,
	email VARCHAR NOT NULL,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);



create table IF NOT EXISTS po.mtl_items (
	item_id serial PRIMARY key,
	item_name VARCHAR NOT NULL,
	uom_code VARCHAR NOT NULL,
	description VARCHAR,
	inactive_date date,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);



create table IF NOT EXISTS po.po_vendors (
	vendor_id serial PRIMARY key,
	vendor_code VARCHAR,
	vendor_name VARCHAR,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);



create table IF NOT EXISTS po.po_vendor_sites (
	vendor_site_id serial PRIMARY key,
	vendor_id int REFERENCES po.po_vendors,
	vendor_site_code VARCHAR UNIQUE NOT null,
	vendor_site_name VARCHAR NOT null,
	address_line_1 VARCHAR NOT null,
	address_line_2 VARCHAR,
	city VARCHAR,
	zip_code VARCHAR,
	country_code VARCHAR,
	purchasing_site_flag VARCHAR,
	payment_site_flag VARCHAR,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);



create table IF NOT EXISTS po.po_vendor_site_contacts (
	vendor_contact_id serial primary key,
	vendor_site_id int REFERENCES po.po_vendor_sites,
	inactive_date DATE,
	first_name VARCHAR NOT null,
	last_name VARCHAR,
	email VARCHAR,
	phone VARCHAR,
	url VARCHAR,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);


CREATE TABLE IF NOT EXISTS po.lookup_hdr (
	lookup_hdr_id serial PRIMARY KEY,
	lookup_type varchar NOT NULL UNIQUE,
	created_date timestamp NULL DEFAULT now(),
	last_updated_date timestamp NULL DEFAULT now()
);

CREATE TABLE IF NOT EXISTS po.lookup_dtl (
	lookup_dtl_id serial PRIMARY KEY,
	lookup_hdr_id int REFERENCES po.lookup_hdr,
	lookup_code varchar NOT NULL,
	lookup_description varchar NULL,
	start_active_date date NOT NULL,
	end_active_date date NOT NULL,
	created_date timestamp NULL DEFAULT now(),
	last_updated_date timestamp NULL DEFAULT now(),
	CONSTRAINT lookup_dtl_lookup_hdr_id_lookup_code_key UNIQUE (lookup_hdr_id, lookup_code));

DELETE
FROM
	po.lookup_dtl
WHERE
	lookup_hdr_id IN (
	SELECT
		lookup_hdr_id
	FROM
		po.lookup_hdr
	WHERE
		lookup_type IN ('PO_STATUS', 'PO_LINE_STATUS', 'AP_STATUS'));

DELETE FROM po.lookup_hdr WHERE lookup_type in ('PO_STATUS', 'PO_LINE_STATUS', 'AP_STATUS');




create TABLE IF NOT exists po.po_headers (
	po_header_id serial PRIMARY key,
	po_number VARCHAR NOT NULL unique,
	agent_id INT REFERENCES po.po_agents,
	status int NOT null,
	po_created_date DATE,
	approved_flag boolean,
	approved_date DATE,
	order_amount INT,
	closed_date date,
	approved_amount INT,
	vendor_site_id INT REFERENCES po.po_vendor_sites,
	po_type VARCHAR,
	vendor_contact_id int REFERENCES po.po_vendor_site_contacts,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);

CREATE TABLE IF NOT exists po.po_lines (
	po_line_id serial PRIMARY key,
	po_header_id int REFERENCES po.po_headers,
	line_num SMALLINT,
	unit_price int NOT null,
	quantity int not NULL,
	discount_percentage float,
	discount_amount int,
	item_id int REFERENCES po.mtl_items,
	line_status int,
	uom_code varchar,
	allow_invoice_price_override_flag boolean,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);

create table IF NOT EXISTS po.ap_agents (
	ap_agent_id serial PRIMARY key,
	first_name VARCHAR NOT null,
	last_name VARCHAR,
	authorization_limit INT,
	start_date_active DATE NOT null,
	end_date_active date NOT null,
	email VARCHAR NOT null,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);

CREATE TABLE po.ap_invoice_headers (
	invoice_id serial PRIMARY key,
	invoice_number varchar NOT NULL unique,
	status int,
	invoice_created_date date NOT NULL,
	invoice_paid_date date,
	amount_invoiced int,
	amount_paid int,
	vendor_site_id int,
	invoice_currency_code varchar,
	payment_currency_code varchar,
	payment_method_lookup_code varchar,
	invoice_received_date date NOT NULL,
	agent_id int REFERENCES po.ap_agents,
	cancelled_by int REFERENCES po.ap_agents,
	invoice_cancelled_date date,
	amount_cancelled int,
	note_paid varchar,
	note_cancelled varchar,
	note_approval varchar,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);

CREATE TABLE po.ap_invoice_lines (
	invoice_line_id serial PRIMARY key,
	invoice_id int REFERENCES po.ap_invoice_headers,
	description varchar,
	po_line_id int REFERENCES po.po_lines, 
	amount_invoiced int,
	amount_paid int,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);








UPDATE po.mtl_items SET created_date = '2021-01-01', last_updated_date = '2021-01-01';
UPDATE po.po_headers SET created_date = po_created_date, last_updated_date = greatest(po_created_date, closed_date, approved_date);
UPDATE po.po_lines pl SET created_date = (SELECT created_date FROM po.po_headers ph WHERE pl.po_header_id = ph.po_header_id);
UPDATE po.po_lines pl SET last_updated_date = (SELECT last_updated_date FROM po.po_headers ph WHERE pl.po_header_id = ph.po_header_id);
UPDATE po.po_agents SET created_date = '2021-01-01', last_updated_date = '2021-01-01';
UPDATE po.ap_agents SET created_date = '2021-01-01', last_updated_date = '2021-01-01';
UPDATE po.ap_invoice_headers SET created_date = invoice_created_date, last_updated_date = GREATEST(invoice_created_date,invoice_paid_date, invoice_received_date, invoice_cancelled_date);
UPDATE po.ap_invoice_headers SET agent_id = 61 WHERE agent_id IS NULL AND mod(invoice_id, 2) = 0;
UPDATE po.ap_invoice_headers SET agent_id = 62 WHERE agent_id IS NULL AND mod(invoice_id, 3) = 0;
UPDATE po.ap_invoice_headers SET agent_id = 63 WHERE agent_id IS NULL;
UPDATE po.ap_invoice_headers SET cancelled_by = agent_id WHERE amount_cancelled IS NOT NULL;
UPDATE po.ap_invoice_lines al SET created_date = (SELECT created_date FROM po.ap_invoice_headers ah WHERE ah.invoice_id = al.invoice_id);
UPDATE po.ap_invoice_lines al SET last_updated_date = (SELECT last_updated_date FROM po.ap_invoice_headers ah WHERE ah.invoice_id = al.invoice_id);
